import { Button, Card } from "react-bootstrap";
import { Trash3Fill } from "react-bootstrap-icons";
import { ExerciseTrackerDayProps } from "../../Interfaces/Day";

function ExerciseTrackerDay({day, reload}: ExerciseTrackerDayProps) {
  const handleDelete = async (e: React.MouseEvent<HTMLButtonElement, MouseEvent>) => {
    const response = await fetch(`http://localhost:5000/api/day/${day.id}`, {
      method: "DELETE",
      headers: {
        "Content-Type": "application/json",
      }
    });

    if (response.ok) {
      reload();
    }
    else {
      alert("Fuck");
    }
  };

  return (
    <Card.Body>
      <Card.Title>
        {day.name} <Button className="btn-trash float-end" onClick={handleDelete}><Trash3Fill /></Button>
      </Card.Title>
    </Card.Body>
  );
}

export default ExerciseTrackerDay;
